      super(props)

     }
     render(){
      return(
        this.props.arr.map((temp)=><div style={{position:'absolute',left:'300px',top:'300px',backgroundColor:'gray'}}><Row arra={temp}/><br/></div>)
      )
     }
}
class Row extends React.Component{
  constructor(props){
    super(props)
  }
  render(){
    return (
      this.props.arra.map((temp)=><><h>{temp}</h><h>{"    "}</h></>)
    )
  }
}
root.render(<Sudoku arr={sudoku} />)
